import React from 'react';

export default ({ date, title }) => {

    let list_col = [];
    let list_row = [];

    for (let i = 0; i <= title.length - 1; i++)
    {
         
        list_row.push(
                        <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                        </tr>
                    )
    }

    return (
        <div>
            <table class="table">
                <thead class="thead-dark">
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    {list_row}
                </tbody>
            </table>
        </div>
    )
};
